import React, {Component} from 'react';
import TodoList from './TodoList';

class Todo extends Component {
    constructor (props) {
        super (props);
        this.state = {
            todoArr: [],
        }
    }



    render() {
        return(
            <div className='TodoList'>
                <TodoList />
            </div>
        )
    }
}

export default Todo;
